import React from 'react';
import './App.css';
import AboutUs from './components/Body/AboutUs/AboutUs';
import Footer from './components/Footer/Footer';
import Header from './components/Header/Header';


function App() {

  return (
    <div className="App">

      <Header/>
      <AboutUs/>
      <Footer/>
    </div>
  );
}

export default App;
